MATCH (c:Commit)-[:parent_of*0..]->(commit:Commit) 
WHERE c.createdAt <= "2024-08-28T19:40:46+00:00Z" 
RETURN commit ORDER BY c.createdAt DESC LIMIT 1;

MATCH (c:Commit)-[:changed {label: 0}]->(f:File) 
WHERE f.name = 'challenge.py' 
RETURN c.message AS message, c.additions AS additions, c.deletions AS deletions, c.patch AS patch;

MATCH (f:File)-[:belongs_to]->(r:Repository)-[:contains_file]->(:Commit) 
WHERE f.name = "multi.py" 
RETURN distinct c;

MATCH (i:Issue)-[:fixed]->(c:Commit) 
WHERE c.committedDate =~ "2023-12-05T00:00:00Z" OR c.committedDate =~ "20\\d{2}-12-05T00:00:00Z" 
RETURN DISTINCT c.id AS commitHash, c.message AS commitMessage;

MATCH (c:Commit)-[:fixed]->(i:Issue)<-[:impacted]-(f:File) 
WHERE c.committedDate =~ "2023-07.*" AND EXISTS((c)-[:introduced]->()) 
RETURN count(c) / COUNT(DISTINCT i) AS percentage;
